CREATE TABLE Plans (
    plan_id INT PRIMARY KEY,
    plan_name TEXT,
    coverage_type TEXT,
    premium DECIMAL
);



CREATE TABLE Enrollments (
    enrollment_id INT PRIMARY KEY,
    member_id INT,
    plan_id INT,
    enrolled_on DATE,
    status TEXT,
    submitted_by TEXT
);



CREATE TABLE Discrepancies (
    discrepancy_id INT PRIMARY KEY,
    enrollment_id INT,
    issue_type TEXT,
    reported_on DATE,
    resolved_on DATE,
    resolution_notes TEXT
);




CREATE TABLE Audit_Log (
    audit_id INT PRIMARY KEY,
    user_id TEXT,
    action_type TEXT,
    table_affected TEXT,
    action_timestamp DATETIME
);

